import React from "react";
import "./APIData.css";
const Data = (props) => {
  return (
    <div>
        <ul>
      <li className="api">
        <h2>{this.props.from}</h2>
        <h3>{this.props.to}</h3>
      </li>
      </ul>
    </div>
  );
};
export default Data;
